// PrinterListComponentStyles.js
const printerListContainerStyle = {
  margin: '20px',
};

const sortDropdownStyle = {
  marginBottom: '10px',
  padding: '8px',
};

const printerListStyle = {
  listStyle: 'none',
  padding: '0',
  margin: '0',
};

const printerItemStyle = {
  margin: '5px 0',
};

export { printerListContainerStyle, sortDropdownStyle, printerListStyle, printerItemStyle };
